import React from "react";
import {
  BrowserRouter,
  Switch,
  Route,
  useParams
} from "react-router-dom";

import Header from "./Header";
import Cats from "./Cats";
import Dogs from "./Dogs";
import "./App.css";

function Main() {
  return (
    <BrowserRouter >
    <div className="main">
      <Header />
      <Switch>
    <Route path="/:id" children={<Child />} />
    </Switch>
    </div>

    </BrowserRouter>

  );
}
function Child() {
  let { id } = useParams();

  function capitalize(str) {
    const capitalized = str[0].toUpperCase() + str.slice(1);
    return capitalized;
  };

  const name = capitalize(id);

  return (
    <div>
       {name} 
    </div>
  );
}
export default Main;
